// ProfileListingPage.jsx
import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const ProfileListingPage = () => {
  const [users, setUsers] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchUsers = async () => {
      const response = await axios.get('https://express-t4.onrender.com/api/users');
      setUsers(response.data);
    };
    fetchUsers();
  }, []);

  return (
    <div>
      <h2>Users</h2>
      <div style={{ display: 'flex', flexWrap: 'wrap' }}>
        {users.map(user => (
          <div key={user._id} style={{ margin: '10px', cursor: 'pointer' }} onClick={() => navigate(`/profile-details/${user._id}`)}>
            <img src={user.picture} alt={user.name} style={{ width: '50px', height: '50px' }} />
            <div>{user.name}</div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ProfileListingPage;
